q = filter q by {{column(Members_MemberCurren_1.selection, ["Market Segment"]).asEquality("Member_Segment_Market_Segment_1")}} or {{column(Members_MemberCurren_1.selection, ["Market Segment"]).asEquality("Member_Segment_Market_Segment_2")}};
q = filter q by {{column(Member_Segment_Segme_1.selection, ["Market Segment"]).asEquality("Member_Segment_Market_Segment_1")}} or {{column(Member_Segment_Segme_1.selection, ["Market Segment"]).asEquality("Member_Segment_Market_Segment_2")}};
Predict1 = group q by 'Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor';
Predict1 = foreach Predict1 generate replace(replace(replace(replace('Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor', ":", " is "), ",", " and "), "__c", ""), "_"," ") as 'predictor', sum('Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor_impact') as 'sum_impact', count() as 'Count';
Predict2 = group q by 'Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor1';
Predict2 = foreach Predict2 generate replace(replace(replace(replace('Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor1', ":", " is "), ",", " and "), "__c", ""), "_"," ") as 'predictor', sum('Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor_impact1') as 'sum_impact', count() as 'Count';
Predict3 = group q by 'Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor2';
Predict3 = foreach Predict3 generate replace(replace(replace(replace('Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor2', ":", " is "), ",", " and "), "__c", ""), "_"," ") as 'predictor', sum('Maximize_Promotion_Influenced_Revenue_Prediction_1_predictor_impact2') as 'sum_impact',count() as 'Count';
q = group Predict1 by predictor full, Predict2 by predictor full, Predict3 by predictor;
q = foreach q generate coalesce(Predict1.'predictor', Predict2.'predictor', Predict3.'predictor') as 'top predictor',(coalesce(sum(Predict1['sum_impact']),0) +coalesce(sum(Predict2['sum_impact']),0) +coalesce(sum(Predict3['sum_impact']),0)) as 'Impact', (coalesce(sum(Predict1['Count']),0) +coalesce(sum(Predict2['Count']),0) +coalesce(sum(Predict3['Count']),0)) as 'Count',  {{cell(lens_2.result, 0, "Predicted Revenue").asString()}} as 'PredictedRevenue';
q = foreach q generate replace('top predictor', ".00000000000000000","") as 'top predictor', 'Impact','PredictedRevenue', number_to_string(('Impact'/'PredictedRevenue'), "#0.00%") as 'PercentageImpact','Count';
q = filter q by 'Impact' <0;
q = order q by 'Impact' asc;
q = limit q 10;

